    return (
        <>
            <Row>
                <Accordion>
                    {
                        dataview.length >= 1 ? (dataview.map((item, index) => {
                            return (<Accordion.Item key={index} eventKey={item.id}>
                                <Accordion.Header>
                                    <div className="m-auto">{item.q}</div>
                                </Accordion.Header>
                                <Accordion.Body>
                                    <div className="px-3 d-inline " >{itr} </div>
                                    <button className="btn-color">مسح السؤال </button>
                                </Accordion.Body>
                            </Accordion.Item>)
                        })) : <h2 className="fs-4 text-center">لا توجد اسئلة</h2>
                    }


                </Accordion>
            </Row >
        </>
    )
}
export default QA;
